import * as React from "react";
import logo from "../../logo.svg";
import Navbars from "../Navbar/navbarLogin";
// import { FaUserAlt, FaAddressCard } from "react-icons/fa";
import { BsArrowRightShort, BsArrowLeftShort } from "react-icons/bs";
import { FiEyeOff, FiEye, FiImage } from "react-icons/fi";
import { AiFillCheckCircle } from "react-icons/ai";
import { MdCameraAlt, MdArrowDropDown } from "react-icons/md";
// import { Link } from "react-router-dom";
import { data, data5 } from "../Data/data";
import emailjs from "@emailjs/browser";

import Login1 from "../../Images/Sign_up.png";

import {
  REGI01_box1EN,
  REGI01_box1DE,
  REGI01_box1TH,
  REGI01_box2EN,
  REGI01_box2DE,
  REGI01_box2TH,
  REGI01_box3EN,
  REGI01_box3DE,
  REGI01_box3TH,
  REGI01_box4EN,
  REGI01_box4DE,
  REGI01_box4TH,
  REGI01_box5EN,
  REGI01_box5DE,
  REGI01_box5TH,
  // RegisterTranslator
  REGI02_Box1v02EN,
  REGI02_Box1v02DE,
  REGI02_Box1v02TH,
  REGI02_Box2v02EN,
  REGI02_Box2v02DE,
  REGI02_Box2v02TH,
  REGI02_Box4v01EN,
  REGI02_Box4v01DE,
  REGI02_Box4v01TH,
  REGI02_Box3v02EN,
